import{A as e,d as t,m as n}from"./chunks/runtime-core.esm-bundler.BXAIOQQS.js";import{t as r}from"./chunks/plugin-vue_export-helper.CtN8rQnz.js";const i=JSON.parse(`{"title":"Software Engineering Concepts","description":null,"frontmatter":{"title":"Software Engineering Concepts","description":null,"date":"2024-09-10T00:00:00.000Z","lastmod":null},"headers":[],"relativePath":"Non-Sorted/ITBA/Software Engineering Concepts/index.md","filePath":"Non-Sorted/ITBA/Software Engineering Concepts/README.md","lastUpdated":1756574703000}`);var a={name:`Non-Sorted/ITBA/Software Engineering Concepts/index.md`};function o(r,i,a,o,s,c){return e(),t(`div`,null,[...i[0]||=[n(`<h1 id="software-engineering-concepts" tabindex="-1">Software Engineering Concepts <a class="header-anchor" href="#software-engineering-concepts" aria-label="Permalink to “Software Engineering Concepts”">​</a></h1><h2 id="course-information" tabindex="-1">Course Information <a class="header-anchor" href="#course-information" aria-label="Permalink to “Course Information”">​</a></h2><h3 id="course-description" tabindex="-1">Course Description <a class="header-anchor" href="#course-description" aria-label="Permalink to “Course Description”">​</a></h3><p>In this course, students will learn about software engineering fundamentals, focusing on software development processes and Integrated Development Environments (IDEs). They will master effective coding practices, library integration, and data manipulation with arrays and collections. The course reinforces robust application building through debugging, testing techniques, and collaborative problem-solving.</p><h3 id="course-delivery" tabindex="-1">Course Delivery <a class="header-anchor" href="#course-delivery" aria-label="Permalink to “Course Delivery”">​</a></h3><p>This course is delivered synchronously, requiring you to engage with course materials, activities, and assessments according to a structured timetable. There are two fixed class times per week, as outlined on your timetable on myCambrian, and you are expected to attend all classes in-person. Remote attendance via Zoom is permitted under approved circumstances. You are expected to collaborate and interact with peers and your professor in real-time during all classes.</p><ul><li><p>In-Person attendance for this class is preferred, however, if you need to attend online, you can do so using the appropriate zoom link.</p></li><li><p>If you have not done so already, please enrol in our Program Moodle and <a href="https://bit.ly/cambrianbagc" target="_blank" rel="noreferrer">introduce yourself</a></p></li></ul><h3 id="assessments" tabindex="-1">Assessments <a class="header-anchor" href="#assessments" aria-label="Permalink to “Assessments”">​</a></h3><p>This section explains the different types of assessments. Each type has its unique role in helping you grasp the course content, as described below. Review the Evaluation Methods portion of your course outline for specifics about the number of assessments and their values.</p><ul><li><p><strong>Assignments</strong>: These help you dive into the material. You&#39;ll explore topics, learn more, and think about what you&#39;ve learned. Assignments are not just tasks; they&#39;re a chance to deeply analyse and reflect on the material.</p></li><li><p><strong>Applied Activities</strong>: This is where you&#39;ll put what you&#39;ve learned into action. It&#39;s all about practising the content. These activities are designed specifically to ensure that you can apply the knowledge in real-world or simulated scenarios.</p></li><li><p><strong>Quizzes</strong>: Quizzes test your knowledge on key points, definitions, and practical results from labs or activities. They serve as a quick check on essential terms, concepts, and application outcomes.</p></li></ul><p>Please complete all assessments before the due date indicated in Moodle, late submissions are subject to a 15% penalty. Submissions cannot be accepted after the &quot;CLASSES END&quot; date indicated on the academic schedule.</p><h3 id="module-sections" tabindex="-1">Module Sections <a class="header-anchor" href="#module-sections" aria-label="Permalink to “Module Sections”">​</a></h3><p>Each module below contains one or more of the following headings: Activities, Resources, Supplemental, Assessments.</p><ul><li><p><strong>Class</strong>: Items related to specific class sessions, including presentations and recordings.</p></li><li><p><strong>Activities</strong>: Comprises mandatory activities to be primarily completed outside of class, with some in-class time provided to commence these tasks.</p></li><li><p><strong>Resources</strong>: Encompasses key resources that must be fully reviewed by students throughout the duration of the module for a comprehensive understanding of the content.</p></li><li><p><strong>Supplemental</strong>: Offers additional, non-mandatory resources and activities for further exploration, enhancing understanding of the module content.</p></li><li><p><strong>Assessments</strong>: Consists of required evaluations like assignments, quizzes, and practical exercises that will be graded and contribute to the final course mark. These assessments may include content from any class session or module excluding items explicitly marked as supplemental materials.</p></li></ul><h3 id="program-guide" tabindex="-1">Program Guide <a class="header-anchor" href="#program-guide" aria-label="Permalink to “Program Guide”">​</a></h3><p>Please complete the following steps prior to your first class and review all of the information contained within the program guide:</p><ol><li><p>Access the appropriate program guide by clicking one of the links below:</p><ul><li><p><a href="https://moodle.cambriancollege.ca/course/view.php?id=39839" target="_blank" rel="noreferrer">IT Business Analysis (BAGC) Program Guide</a></p></li><li><p><a href="https://moodle.cambriancollege.ca/course/view.php?id=39840&amp;source=bitly" target="_blank" rel="noreferrer">Mobile Application Development (MAPD) Program Guide</a></p></li></ul></li><li><p>Click on &quot;enrol&quot; to access the program guide.</p></li><li><p>Review all the information contained within each of the sections of the program guide.</p></li><li><p>Click on the “Introduce Yourself” questionnaire and answer the questions.</p></li></ol>`,17)]])}var s=r(a,[[`render`,o]]);export{i as __pageData,s as default};